import React from "react";
import { Nav, NavbarContainer, NavLogo } from "./NavbarElements";

// Note: write rafce to quickly create the import react and arrow function template.

const Navbar = () => {
  return (
    <>
      <Nav>
        <NavbarContainer>
                  <NavLogo to="/">dolla</NavLogo>
                  <MobileIcon>
                      <FaBars />
                  </MobileIcon>
                  <NavMenu>
                      <NavItem>
                          <NavLinks to="about">About</NavLinks>
                      </NavItem>
                  </NavMenu>
            <h1>Hey</h1>
        </NavbarContainer>
      </Nav>
    </>
  );
};

export default Navbar;
